import React from 'react'
import "./font.css";

export const Font = () => {
    const changeBackground = (e)=> {
        // e.target.style.background = 'red';
        if (window.__changeBackground)
             return false;
             this.start();

      }

    return (
        <div className=' '>
            <div className='' align="center">
                <div align="Center"><font size="6"><b><h1>Youthrozgar : Youthrozgar.Com Sarkari Naukri Latest Jobs Online Form  2022 </h1></b></font></div>
                <div className='text-blue-700 ' id="marquee1" align="center">
                    <marquee behavior="alternate" onMouseOver={changeBackground} onmouseout="if (!window.__cfRLUnblockHandlers) return false; this.start();"><a href="https://www.sarkariresult.com/2022/up-cppnet-2022/" ><b>
                        <font size="3">UPCPPNET Online Form 2022</font>
                    </b></a> || <a href="https://www.sarkariresult.com/2022/nvs-tgt-pgt-jul22/" ><b>
                        <font size="3">NVS TGT PGT Online Form 2022</font></b></a> | | <a href="https://www.sarkariresult.com/2022/up-iti-admission-2022/" ><b>
                            <font size="3">UP ITI Admission Online Form 2022</font></b></a></marquee>
                </div><div className='text-red-700 relative' id="marquee1" align="center">
                    <marquee behavior="alternate" onmouseover="if (!window.__cfRLUnblockHandlers) return false; this.stop();" onmouseout="if (!window.__cfRLUnblockHandlers) return false; this.start();"><a href="https://www.sarkariresult.com/2022/army-agniveer-rally/" ><b>
                        <font size="3">Indian Army Agniveer Online Form 2022</font></b></a> || <a href="https://www.sarkariresult.com/rpsc/rpsc-protection-off-07-2022/" ><b><font size="3">RPSC Protection Officer Online Form 2022</font></b></a> || <a href="https://www.sarkariresult.com/2022/pgcil-apprentice/" ><b><font size="3">PGCIL Apprentice Online Form 2022</font></b></a></marquee>
                </div><div className='text-green-700 relative' id="marquee1" align="center">
                    <marquee behavior="alternate" onmouseover="if (!window.__cfRLUnblockHandlers) return false; this.stop();" onmouseout="if (!window.__cfRLUnblockHandlers) return false; this.start();"><a href="https://www.sarkariresult.com/ssc/ssc-revised-calendar-2022/" ><b>
                        <font className='relative' size="3">SSC Revised Calendar 2022</font></b></a> || <a href="https://www.sarkariresult.com/2022/bihar-2yr-bed-cet-2022/" ><b><font size="3">Bihar 2 Year BEd Answer Key 2022</font></b></a> || <a href="https://www.sarkariresult.com/2022/drdo-scientist-b-jul22/" ><b><font size="3">DRDO Scientist B Online Form 2022</font></b></a></marquee>
                </div></div> 

        </div>

    )
}
